<body ng-app="main" class="" style="overflow: hidden">
<div ng-controller="nav" class="row navigation"
     style="position:fixed;margin-bottom: 0px !important;height:30px;width: 100%;">
    <div class="col s12"></div>
    <div class="controls col s12">
        <div class="row" style="margin-bottom: 0px !important;">
            <button class="waves-effect waves-light btn col s4" ng-click="update(-1)">Previous</button>
            <button class="waves-effect waves-light btn col s4 disabled">Question: {{question}}</button>
            <button class="waves-effect waves-light btn col s4" ng-click="update(1)">Next</button>
        </div>
    </div>
</div>
<iframe ng-src="{{url}}" id="browser" style="
margin-top: 30px;
width: 100%;
    height:100%;
"></iframe>
</body>
<script>
    let module = angular.module("main", []);
    module.controller("nav", function ($scope) {
        console.dir($scope);
        $scope.browser = document.querySelector(`#browser`);
        $scope.currentIndex = 0;
        $scope.question="-1";
        if (questions.length) {
            if (location.hash.substring(1) === "") {
                $scope.browser.src = `https://gateoverflow.in/${questions[0].substr(1)}`;
                $scope.currentIndex = 0;
                $scope.question="1";
            } else {
                $scope.currentIndex = parseInt(location.hash.substring(1));
                $scope.question = $scope.currentIndex + 1;
                $scope.browser.src = `https://gateoverflow.in/${questions[$scope.currentIndex].substr(1)}`
            }
        }
        $scope.update = function (step) {
            let newIndex = $scope.currentIndex + step;
            if (newIndex >= 0) {
                if (newIndex < questions.length) {
                    $scope.browser.src = `https://gateoverflow.in/${questions[newIndex].substr(1)}`;
                    $scope.currentIndex = newIndex;
                    location.hash = newIndex;
                    $scope.question = newIndex + 1;
                }
            }
            ;
        };
        $scope.full = full;
    });
</script>
<style>
    iframe {
        border: none;
    }

    .hr {
        background-color: blue;
        height: 2px;
    }

    .controls {
        float: right;
    }

    #browser {
        width: 100%;
        height: 100%;
    }

    html, body {
        height: 100%;
    }
</style>
</html>
